import React from 'react';
import './styles/App.css';
import Sidebar from './components/Sidebar';
import FileUploader from './components/FileUploader';

function App() {
  return (
    <div className="app-container">
      <Sidebar />
      <main className="main-content">
        <h1>PDFアップローダー</h1>
        <FileUploader />
      </main>
    </div>
  );
}

export default App;
